	function affixSidebarInit() {
		var $affixAside = jQuery('.affix-aside');
		if ($affixAside.length) {

			//on stick and unstick event
			$affixAside.on('affix.bs.affix', function (e) {
				var affixWidth = $affixAside.width() - 1;
				var affixLeft = $affixAside.offset().left;
				$affixAside.width(affixWidth).css("left", affixLeft);
			}).on('affix-top.bs.affix affix-bottom.bs.affix', function (e) {
				$affixAside.css({ "width": "", "left": "" });
			});

			//counting offset
			var offsetTop = $affixAside.offset().top - jQuery('.page_header').height();
			var offsetBottom = jQuery('.page_footer').outerHeight(true) + jQuery('.page_copyright').outerHeight(true);

			$affixAside.affix({
				offset: {
					top: offsetTop,
					bottom: offsetBottom
				}
			});

			jQuery(window).on('resize', function () {
				$affixAside.css({ "width": "", "left": "" });

				if ($affixAside.hasClass('affix')) {
					//returning sidebar in top position if it is sticked because of unexpacted behavior
					$affixAside.removeClass("affix").css("left", "").addClass("affix-top");
				}

				var offsetTop = jQuery('.page_topline').outerHeight(true) + jQuery('.page_toplogo').outerHeight(true) + jQuery('.page_header').outerHeight(true) + jQuery('.page_breadcrumbs').outerHeight(true) + jQuery('.blog_slider').outerHeight(true);
				var offsetBottom = jQuery('.page_footer').outerHeight(true) + jQuery('.page_copyright').outerHeight(true);

				$affixAside.data('bs.affix').options.offset.top = offsetTop;
				$affixAside.data('bs.affix').options.offset.bottom = offsetBottom;

				$affixAside.affix('checkPosition');
			});
		} //eof checking of affix sidebar existing
	}

	//helper functions to init elements only when they appears in viewport (jQUery.appear plugin)
	function initAnimateElement(self, index) {
		var animationClass = !self.data('animation') ? 'fadeInUp' : self.data('animation');
		var animationDelay = !self.data('delay') ? index * 150 : self.data('delay');
		setTimeout(function () {
			self.addClass("animated " + animationClass);
		}, animationDelay);
	}
	function initCounter(self) {
		if (self.hasClass('counted')) {
			return;
		} else {
			self.countTo().addClass('counted');
		}
	}
	function initProgressbar(el) {
		el.progressbar({
			transition_delay: 300
		});
	}
	function initChart(el) {
		var data = el.data();
		var size = data.size ? data.size : 270;
		var line = data.line ? data.line : 20;
		var bgcolor = data.bgcolor ? data.bgcolor : '#ffffff';
		var trackcolor = data.trackcolor ? data.trackcolor : '#c14240';
		var speed = data.speed ? data.speed : 3000;

		el.easyPieChart({
			barColor: trackcolor,
			trackColor: bgcolor,
			scaleColor: false,
			scaleLength: false,
			lineCap: 'butt',
			lineWidth: line,
			size: size,
			rotate: 0,
			animate: speed,
			onStep: function onStep(from, to, percent) {
				jQuery(this.el).find('.percent').text(Math.round(percent));
			}
		});
	}

